import React from 'react';
import{BrowserRouter, Route, Switch} from 'react-router-dom';
import './App.css';


function App() {
  return (
    <BrowserRouter>
    <div className = 'container'>

      <Switch>
        <Route path='/' component ='Home' exact />
      </Switch>
    </div>
    </BrowserRouter>
  );
}

export default App;
